import React, { Component } from 'react';

class BoardDetail extends Component {
    constructor(){
        super();
        this.state = {
            // boards: [this.props]
        }
    }
    render(){
        console.log(this.props.boards[0].title, 'this.props.boards.title');
        console.log(this.props.boards, 'this.props.boards');

        // <img alt={i} src={ this.state.boards[i].data[i].images[i] } />
        // const imageList = this.props.boards.data.images.map((image, i) => {
        //     return (
        //         <img alt={i} src={ image } />
        //     )
        // })
        const boardsList = this.props.boards.map((board, i) => {
            return (
                <div key={ board.data._id }>
                    <div>{ board.data.title }</div>
                    <div>{ board.data.description }</div>
                </div>
            )
        });   
        return(
            <div>
                <h1>BoardDetail</h1>
                <div>
                    { boardsList }
                </div>
            </div>
        )
    }
}

export default BoardDetail;
